import React from "react";
const ProductList = ()=>{
    return(
       
        <div className="product-list">
        <h3>Product List</h3>
        <ul>
            <li>S.No</li>
            <li>Name</li>
            <li>Price</li>
            <li>Category</li>
            <li>Company</li>
            <li>Operation</li>
        </ul>
        </div>
    )
}

export default ProductList;
